type MyProps = {
   positionName : string,
   positionDesc : string,
  };

  class PositionsDescription extends React.Component<MyProps> {
    render() {
        const { positionName, positionDesc } = this.props
      return (
        <div className="accordion-item">
          <h2 className="accordion-header" id="headingOne">
            <button className="accordion-button collapsed" type="button" data-bs-toggle="collapse" data-bs-target="#collapseOne" aria-expanded="true" aria-controls="collapseOne">
              {positionName}
            </button>
          </h2>
          <div id="collapseOne" className="accordion-collapse collapsed" aria-labelledby="headingOne" data-bs-parent="#accordionExample">
            <div className="accordion-body">
              {positionDesc}
            </div>
          </div>
        </div>
      );
    }
  }
export default PositionsDescription;
